import React from 'react'
import { NavItem,Navbar } from 'react-bootstrap'

const Nav_bar = () => {
  return (
  <Navbar>
    <NavItem>
      <img src="logo.jpeg" alt="logo" className='imfluid'/>
    </NavItem>
  </Navbar>
  )
}

export default Nav_bar
